from server import *


@app.errorhandler(404)
def page_not_found(self):
    links = [
        "data:image/jpeg;base64,",
        "https://i.pinimg.com/originals/86/41/80/86418032b715698a4dfa6684b50c12af.gif",
        "https://freefrontend.com/assets/img/html-funny-404-pages/HTML-404-Error-Page.gif",
        "https://assets.materialup.com/uploads/c13818e8-9e42-4f4d-b657-38743a81b270/preview.gif",
        "https://i.gifer.com/7iJb.gif",
        "https://kfg6bckb.media.zestyio.com/yalantis-interactive-404.gif",
    ]
    return render_template("/error/404.html", links=links)


@app.errorhandler(505)
def server_error(self):
    try:
        links = [
            "data:image/jpeg;base64,",
            "https://media0.giphy.com/media/TqiwHbFBaZ4ti/giphy.gif",
            "https://freefrontend.com/assets/img/500-error-page-html-templates/HTML-CSS-500-Internal-Error-Page.gif",
            "https://mobile.tradeinvalet.com/Content/Images/Error_Image.gif",
            "data:image/png;base64,",
        ]
        return render_template("/error/505.html", links=links)
    except:
        return abort(404)
